import React,{Component} from 'react';
import axios from 'axios';

class CreateBlock extends Component {
  state = {
    thisBlock, nextBlock
  };

  async createBlock() {
    const response = await axios.post('/block/create', {
        thisBlock : thisBlock,
        nextBlock : nextBlock
    }).then((response) => {
        console.log(response);
      }, (error) => {
        console.log(error);
      });
  }

  render() {
    const {blocks} = this.state;
    return (
        <div classname = "container">
        <head> 
        <link rel="stylesheet" href="index.css"/>
          BlockChain Application 
          </head>
        <body>
            <h1 class = "Heading">Trojan's BlockChain</h1>
            <hr></hr>
            <div class = "form-group">
              <form onSubmit={ onSubmit }>
                <label>This block</label>
                <br></br>
                <br></br>
                <input
                  value = { thisBlock }
                  onChange={(e) => setThisBlock(e.target.value)}
                  class="form-control"/>
                  <br></br>
                  <br></br>
                  <label>Next block</label>
                <br></br>
                <br></br>
                <input
                  value = { nextBlock }
                  onChange={(e) => setNextBlock(e.target.value)}
                  class="form-control"/>
                  <br></br>
                  <br></br>
                  <button class="btn">Submit</button>
              </form>
            </div>
        </body>
        </div>
    );
};

}
